// src/components/CustomNavbar.js
import React from 'react';
import { Container, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import logo from 'public//logo.png';
const Navbar_Button = () => {

    return (
        <Container className="text-left">
            <Button as={Link} to="/" variant="primary" className="me-2">Home
            <img src={logo} alt="logo" style={{ width: '20px', marginRight: '8px' }} />
            </Button>
            <Button  as={Link} to="/add" variant="warning" className="me-2">Add Employee</Button>
        </Container>
    );
};

export default Navbar_Button;
